BEGIN TRANSACTION;
CREATE TABLE "genre" (
	"GenreId"	INTEGER,
	"Name"	varchar(45) NOT NULL,
	PRIMARY KEY("GenreId")
);
CREATE TABLE "iTunesExclusion" (
	"collectionId"	INTEGER,
	"trackId"	INTEGER
);
CREATE TABLE "vendor" (
	"vendorId"	INTEGER NOT NULL IDENTITY PRIMARY KEY,
	"name"	TEXT NOT NULL,
);
CREATE TABLE "thumbnail" (
	"thumbnailId"	INTEGER NOT NULL UNIQUE  IDENTITY PRIMARY KEY,
	"videoId"	TEXT NOT NULL,
	"type"	TEXT NOT NULL,
	"url"	TEXT NOT NULL,
	"width"	INTEGER NOT NULL,
	"height"	INTEGER NOT NULL,
	FOREIGN KEY("videoId") REFERENCES "video"("videoId")
);
CREATE TABLE "user" (
	"UserId"	int NOT NULL  IDENTITY PRIMARY KEY,
	"UserName"	varchar(45) NOT NULL,
	"Password"	varchar(45) NOT NULL,
);
CREATE TABLE "video" (
	"videoId"	INTEGER NOT NULL IDENTITY PRIMARY KEY,
	"etag"	TEXT,
	"publishedAt"	TEXT,
	"title"	TEXT,
	"description"	TEXT,
	"sourceSystemId"	TEXT NOT NULL UNIQUE
);
CREATE TABLE "iTunesCollection" (
	"iTunesCollectionId"	INTEGER NOT NULL IDENTITY PRIMARY KEY,
	"collectionId"	int NOT NULL,
	"artistId"	int NOT NULL,
	"trackId"	int,
	"artistName"	text,
	"artistViewUrl"	text,
	"artworkUrl30"	text,
	"artworkUrl60"	text,
	"artworkUrl100"	text,
	"collectionCensoredName"	text,
	"collectionExplicitness"	text,
	"collectionName"	text,
	"collectionPrice"	decimal(18, 2),
	"collectionType"	text,
	"collectionViewUrl"	text,
	"copyright"	text,
	"country"	text,
	"currency"	text,
	"discCount"	int,
	"discNumber"	int,
	"isStreamable"	text,
	"kind"	text,
	"previewUrl"	text,
	"primaryGenreName"	text,
	"releaseDate"	date,
	"sourceArtistId"	INTEGER,
	"trackCensoredName"	text,
	"trackCount"	int,
	"trackExplicitness"	text,
	"trackName"	text,
	"trackNumber"	int,
	"trackPrice"	NUMERIC,
	"trackTimeMillis"	int,
	"trackViewUrl"	text,
	"wrapperType"	text,

	UNIQUE("collectionId")
);
CREATE TABLE "iTunesTrack" (
	"iTunesTrackId"	INTEGER NOT NULL IDENTITY PRIMARY KEY,
	"trackId"	int NOT NULL,
	"collectionId"	int NOT NULL,
	"artistId"	int,
	"artistName"	text,
	"artistViewUrl"	text,
	"artworkUrl30"	text,
	"artworkUrl60"	text,
	"artworkUrl100"	text,
	"collectionCensoredName"	text,
	"collectionExplicitness"	text,
	"collectionName"	text,
	"collectionPrice"	decimal(18, 2),
	"collectionType"	text,
	"collectionViewUrl"	text,
	"copyright"	text,
	"country"	text,
	"currency"	text,
	"discCount"	int,
	"discNumber"	int,
	"isStreamable"	text,
	"kind"	text,
	"previewUrl"	text,
	"primaryGenreName"	text,
	"releaseDate"	date,
	"sourceArtistId"	INTEGER,
	"trackCensoredName"	text,
	"trackCount"	int,
	"trackExplicitness"	text,
	"trackName"	text,
	"trackNumber"	int,
	"trackPrice"	decimal(18, 2),
	"trackTimeMillis"	int,
	"trackViewUrl"	text,
	"wrapperType"	text,

	UNIQUE("collectionId","trackId")
);
CREATE TABLE "release" (
	"releaseId"	INTEGER NOT NULL IDENTITY PRIMARY KEY,
	"collectionId"	INTEGER NOT NULL,
	"artistId"	INTEGER NOT NULL,
	"vendorId"	INTEGER NOT NULL,
	"artistName"	TEXT NOT NULL,
	"title"	TEXT NOT NULL,
	"country"	TEXT,
	"releaseDate"	TEXT NOT NULL,
	"genre"	TEXT,
	"price"	NUMERIC,
	"artworkUrl"	TEXT,
	"buyUrl"	TEXT NOT NULL,
	"artistViewUrl"	TEXT NOT NULL,
	"previewUrl"	TEXT,
	"copyright"	TEXT,
	"discCount"	INTEGER,
	"discNumber"	INTEGER,
	"isOriginal"	INTEGER,
	"isRemix"	INTEGER,

	FOREIGN KEY("artistId") REFERENCES "artist"("artistId")
);
CREATE TABLE "releaseTrack" (
	"releaseTrackId"	INTEGER NOT NULL IDENTITY PRIMARY KEY,
	"releaseId"	INTEGER NOT NULL,
	"trackId"	INTEGER NOT NULL,
	"artistName"	TEXT NOT NULL,
	"title"	BLOB NOT NULL,
	"previewUrl"	NUMERIC NOT NULL,
	"trackTimeInMillis"	INTEGER,
	"trackNumber"	INTEGER NOT NULL,
	"price"	NUMERIC,
	FOREIGN KEY("releaseId") REFERENCES "release"("releaseId")
);
CREATE TABLE "artist" (
	"artistId"	INTEGER NOT NULL IDENTITY PRIMARY KEY,
	"name"	TEXT NOT NULL,
	"description"	TEXT,
);
CREATE TABLE "siteVersion" (
	"siteVersionId"	INTEGER NOT NULL IDENTITY PRIMARY KEY,
	"name"	TEXT,
	"url"	TEXT,
	"technology"	TEXT,
	"active"	INTEGER,
);
CREATE TABLE "mixTrack" (
	"TrackId"	INTEGER NOT NULL UNIQUE IDENTITY PRIMARY KEY,
	"MixId"	int NOT NULL,
	"Number"	int NOT NULL,
	"Artist"	varchar(100) NOT NULL,
	"Title"	varchar(200) NOT NULL,
	"Remix"	varchar(100) DEFAULT NULL,
	"Label"	varchar(75) DEFAULT NULL,
	FOREIGN KEY("MixId") REFERENCES "mix"("MixId")
);
CREATE TABLE "mix" (
	"MixId"	int IDENTITY PRIMARY KEY,
	"GenreId"	int NOT NULL,
	"title"	varchar(100) NOT NULL,
	"artist"	varchar(50) NOT NULL,
	"length"	varchar(20) NOT NULL,
	"shortDescription"	varchar(255) DEFAULT NULL,
	"description"	varchar(255),
	"audioUrl"	varchar(100),
	"artworkUrl"	varchar(100),
	"createDate"	date NOT NULL,
	"category"	varchar(20) NOT NULL,
	"totalPlays"	REAL NOT NULL,
	"lastPlay"	date NOT NULL DEFAULT '1900-01-01',
	"show"	INTEGER,
	FOREIGN KEY("GenreId") REFERENCES "genre"("GenreId")
);
CREATE TABLE "log" (
	"Id"	INTEGER NOT NULL IDENTITY PRIMARY KEY,
	"Message"	TEXT,
	"RenderedMessage"	TEXT,
	"MessageTemplate"	TEXT,
	"Level"	TEXT,
	"TimeStamp"	TEXT,
	"Exception"	TEXT,
	"Properties"	TEXT,
);
CREATE TABLE "apiData" (
	"apiDataId"	INTEGER NOT NULL IDENTITY PRIMARY KEY,
	"apiDataType"	TEXT NOT NULL,
	"artist"	TEXT,
	"url"	TEXT NOT NULL,
	"data"	TEXT NOT NULL,
	"total"	INTEGER,
	"lastUpdate"	TEXT NOT NULL,
);
