INSERT INTO "video" ("videoId","etag","publishedAt","title","description","sourceSystemId") VALUES (930,'6VLzmv4LudjNJfK8TxfDO0nEHLw','2017-10-22 15:24:18','October Spooky Patch - Braids + Rings + Eventide Harmonizer','2 separate arpeggiators feeding into CVPal.  Low part is Braids into Ripples into DVCA.  Envelope created by Peaks and fed into Shades, then combined with LFO and modulating Ripples Freq.     Sequence fed into Harmonizer on Black Hole preset, 100% wet.

High part is Rings directly into DVCA ch 2, enveloped by Peaks ch 2.  Additional reverb from Valhalla Shimmer and a bit of delay from Native Instruments Replika.

Gates for both channels going into SSSR Labs VC Divider with divisions modulated by VCLFO.  Out from VC Divider into Branches for more gate randomness.

more modular videos:  https://www.youtube.com/playlist?list=PLvrGGNimrTIMSxEt7InO9NK_aUplnK513
